The best thing that came from 2020 (aside from my darling first born) were the intimate weddings. Don’t get me wrong, I love a big wedding with a band and a million people on the dance floor but…truly nothing beats your closest friends and family gathered around a couple of tables to celebrate your love. 

I’ll take more of those, please 🥂

